import React from 'react';

class Recources extends React.Component {
    render() {
        return (
              <div id="offline-resources">
                <div id="offline-resources-1x">
                  <img id="1x-obstacle-large" src="data:image/png;base64,"/>
                  <img id="1x-obstacle-small" src="data:image/png;base64,"/>
                  <img id="1x-cloud" src="data:image/png;base64,"/>
                  <img id="1x-text" src="data:image/png;base64,"/>
                  <img id="1x-horizon" src="data:image/png;base64,"/>
                  <img id="1x-trex" src="data:image/png;base64,"/>
                  <img id="1x-restart" src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAACQAAAAgCAQAAADQmBIFAAAAZklEQVR4Xu3WMQoAIAxDUe/Y+58jYwV1CwQJWQT5o/DAoaWjV2i/LRym/A5FjEsR41LPQchByEHwIVAEC4gZpghmSDP8egXpr/hQZaAKQFQe+pBOQAblDC336qrlPpSg0MEjInbWTLFFmwc8TpTAAAAAAElFTkSuQmCC"/>
                </div>
                <div id="offline-resources-2x">
                  <img id="2x-obstacle-large" src="data:image/png;base64,"/>
                  <img id="2x-obstacle-small" src="data:image/png;base64,"/>
                  <img id="2x-cloud" src="data:image/png;base64,"/>
                  <img id="2x-text" src="data:image/png;base64,"/>
                  <img id="2x-horizon" src="data:image/png;base64,"/>
                  <img id="2x-trex" src="data:image/png;base64,"/>
                  <img id="2x-restart" src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAEgAAABAAgMAAADE0Nm5AAAACVBMVEX////39/dTU1OabbyfAAAAAXRSTlMAQObYZgAAAGNJREFUeF7d1CEOwDAMQ9GS3q/ExPcz8Sm3gYBWVRo0afvwSQl0ax1To22JntKWupfGjriSXiLViCXCmXBHCykJTxaYEeIQGcVrHYklcoX8YYpSUggzcpBTiv5JtQWorUltmS6s4ZKtz2GgjAAAAABJRU5ErkJggg==" />
                </div>
                <template id="audio-resources">
                  <audio id="offline-sound-press" src="data:audio/mpeg;base64,"></audio>
                  <audio id="offline-sound-hit" src="data:audio/mpeg;base64,"></audio>
                  <audio id="offline-sound-reached" src="data:audio/mpeg;base64,"></audio>
                </template>
              </div>
        )
    }
}

export default Recources;
